import * as ReactDOM from 'react-dom/client';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
export * from './runtime';
export * from './apis';
export * from './models';
import GetObjectsFromApi from './pages/objects';

import { DefaultConfig, Configuration } from './runtime';
import MenuNavbar from './pages/components/menu';

DefaultConfig.config = new Configuration( { basePath: 'http://0.0.0.0:3000' } );

const root = ReactDOM.createRoot(document.getElementById('root')!);
root.render(
    <div>
        <MenuNavbar />
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<GetTanksFromApi />} />
                <Route path="object" element={<GetObjectsFromApi />} />
            </Routes>
        </BrowserRouter>
    </div>
);
